import {
  BrowserRouter as Router,
  Route,
  Routes,
  useHistory,
} from "react-router-dom";
import { Navbar, Nav, Container, NavDropdown, Button } from "react-bootstrap";
import { LinkContainer } from "react-router-bootstrap";
import Participants from "./components/Participants";

function App() {
  const navigate = useNavigate();

  const routeChange = () => {
    let path = `/participants`;
    let history = useHistory();
    history.push(path);
  };
  return (
    <Router>
      <Container>
        <LinkContainer to="/participants">
          <Button href="/participants" onClick={routeChange}>
            Link
          </Button>
        </LinkContainer>
      </Container>
      <Routes>
        {/* <Button></Button> */}
        <Route path="/paticipants" element={<Participants />} exact />
      </Routes>
    </Router>
  );
}

export default App;
